خیلی از ما حتی بلد نیستیم آرزو کنیم و گاهی آرزوهایمان را هم از روی دست بقیه تقلب می‌کنیم. نگاه می‌کنیم ببینیم مردم دوست دارند کجا زندگی کنند؟ مردم دوست دارند با چجور آدمی ازدواج کنند؟ مردم عاشق کدام ماشین هستند؟ کدام مارک کیف و کفش و لباس هست که اگر بپوشی همه دهانشان باز می‌ماند؟ خلاصه می‌نشینیم آرزوهای مردم را درمیاوریم و میفهمیم مردم چی دوست دارند بعد همان‌‌ چیزها را می‌گذاریم در لیست آرزوهایمان
آن وقت هدفمان از خریدن هر چیزی فقط دراوردنِ چشم بقیه است هدفمان از شغلی که می‌خواهیم بدست بیاوریم کور کردنِ چشم حسودان است و هدفمان از ازدواجمان این است هر کس زندگی‌مان را دید دلش بخواهد جای ما باشد! ❤💋
ولی راستش ما با آرزوهایی که مال خودمان نیست هیچ وقت رنگ خوشبختی را نخواهیم دید. شاید در مقابل این همه جانی که داریم می‌کَنیم موفق شویم حسرتِ دیگران را بخریم اما زندگی‌ای که چشم مردم دنبالش باشد به دهان آدم مزه نمی‌کند که!
من فکر می‌کنم کاش هر کدام آرزوهای خودمان را داشتیم و پیِ دلِ خودمان می‌رفتیم وقتی آرزوهای یکدیگر را می‌دزدیم، خوشحالیِ رسیدن به آرزوهایمان بارِ دلِ آنهایی می‌شود که آن آرزو را دارند و بهش نرسیده‌اند.
این یعنی شادی‌ای که یک وَرَش غم است من دوست دارم دنبالِ دلِ خودم بروم و برای آرزوهای خودم زندگی‌ام را خرج کنم. من دلم شادی‌ای می‌خواهد که همه‌وَرَش شادیست با آرزوهایی که مالِ خودِ خودِ خودم است!
